import React from 'react'
import { useDispatch } from 'react-redux';
import { changeTable } from '../../../redux/foodSlice';

function Login() {
    return (
        <div className='login'>
            <div class="mb-3">
                <input type="text" class="form-control" id="exampleFormControlInput1" placeholder="Enter Table No." />
                <div className="text-center">
                <button className="btn btn-primary my-2">Login</button>

                </div>
            </div>
        </div>
    )
}

export default Login
